import React from 'react';
import styles from '../css/QuickSearch.css'

class QuickSearch extends React.Component {

    constructor(props) {
        super(props);

        this.state = {
            title: this.props.title,
            link: this.props.link,
        }
    }

    render () {
        return (
            <a style={styles.link} href={this.state.link}>
                <div className="tag" style={styles.tag}>
                    <p className="tag-p" style={styles.text}>{this.state.title}</p>
                </div>
            </a>
        )
    }
}

export default QuickSearch;
